package org.jzw.yxbs.vo;import java.util.Date;public class UserVo {		private Long userId;	private String username;	private String role;	private Integer isenable;	private Date createDate;	private Date modifyDate;		public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public String getUsername() {		return username;	}	public void setUsername(String username) {		this.username = username;	}	public String getRole() {		return role;	}	public void setRole(String role) {		this.role = role;	}	public Integer getIsenable() {		return isenable;	}	public String getDisplayIsenable() {		if (isenable == null) {			return "";		}		if (isenable == 1) {			return "enabled";		} else {			return "disabled";		}	}	public void setIsenable(Integer isenable) {		this.isenable = isenable;	}	public Date getCreateDate() {		return createDate;	}	public void setCreateDate(Date createDate) {		this.createDate = createDate;	}	public Date getModifyDate() {		return modifyDate;	}	public void setModifyDate(Date modifyDate) {		this.modifyDate = modifyDate;	}	}